import React, {useEffect, useMemo, useState} from 'react';
import {makeStyles, useTheme} from '@material-ui/styles';

import {
    Button,
    Card,
    CardContent,
    OutlinedInput,
    Icon,
    TextField,
    Typography,
    CardActions,
    Divider,
    Select,
    InputLabel,
    FormControl,
    MenuItem,
    LinearProgress
} from '@material-ui/core';
import {Link} from 'react-router-dom';

export default function PastOfferingCard(props)
{
    const theme = useTheme();

return(
            <div className="w-full pb-24 sm:w-1/2 lg:w-1/3 sm:p-16" key={props.id}>
                <Card elevation={1} className="flex flex-col h-256">
                    <div
                        className="flex flex-shrink-0 items-center justify-between px-24 h-64"
                        style={{
                             background: props.color,
                             color     : 'blue'
                        }}
                    >
                        <Typography className="font-medium truncate" color="inherit">Session:{props.session} Sem: {props.sem}</Typography>

                    </div>

                    <CardContent className="flex flex-col flex-auto items-center justify-center">
                        <Typography className="text-center text-16 font-400">{props.name} CS305</Typography>
                        <Typography className="text-center text-16 font-300"> by {props.teacherName}</Typography>
                        <Typography className="text-center text-16 font-100"> {props.enrolments} Enrolments </Typography>
                    </CardContent>
                    <Divider/>
                    <CardActions className="justify-center">
                        <Button
                            to={`/academy/crp/pastOfferingDetails/1/`}
                            component={Link}
                            className="justify-start px-32"
                            color="secondary"
                        >
                           More Details
                        </Button>
                    </CardActions>
                </Card>
            </div>
        )

}
